SELECT s1.DEVICE, s1.IMAGE_WIDTH, s1.IMAGE_HEIGHT, s1.FACET_SIZE, s1.DEFORMATION_COUNT, s1.TEST_CASE, s1.VARIANT, s1.LWS0, s1.LWS1, s1.LWS_SUB, s1.TIME_TOTAL, s1.TIME_KERNEL
FROM APP."DATA" s1
LEFT JOIN APP."DATA" s2 ON 
    s1.DEVICE = s2.DEVICE AND s1.IMAGE_WIDTH = s2.IMAGE_WIDTH AND 
    s1.IMAGE_HEIGHT = s2.IMAGE_HEIGHT AND s1.FACET_SIZE = s2.FACET_SIZE AND 
    s1.DEFORMATION_COUNT = s2.DEFORMATION_COUNT AND s1.TEST_CASE = s2.TEST_CASE AND
    s1.VARIANT = s2.VARIANT AND s1.TIME_TOTAL < s2.TIME_TOTAL
WHERE s2.TIME_TOTAL IS NULL;